Ext.onReady(function(){Ext.apply(Ext.form.field.VTypes,{daterange:function(d,c){var b=c.parseDate(d);if(!b){return false}if(c.startDateField&&(!this.dateRangeMax||(b.getTime()!=this.dateRangeMax.getTime()))){var e=c.up("form").down("#"+c.startDateField);e.setMaxValue(b);e.validate();this.dateRangeMax=b}else{if(c.endDateField&&(!this.dateRangeMin||(b.getTime()!=this.dateRangeMin.getTime()))){var a=c.up("form").down("#"+c.endDateField);a.setMinValue(b);a.validate();this.dateRangeMin=b}}return true},timerange:function(d,c){var b=c.parseDate(d);if(!b){return}if(c.startTimeField&&(!this.timeRangeMax||(b.getTime()!=this.timeRangeMax.getTime()))){var e=Ext.getCmp(c.startTimeField);e.maxValue=b;e.validate();this.timeRangeMax=b}else{if(c.endTimeField&&(!this.timeRangeMin||(b.getTime()!=this.timeRangeMin.getTime()))){var a=Ext.getCmp(c.endTimeField);a.minValue=b;a.validate();this.timeRangeMin=b}}return true},daterangeText:"Start date must be less than end date",numberrange:function(c,b){if(!c){return}if(b.startNumberField&&(!b.numberRangeMax||(c!=b.numberRangeMax))){var d=Ext.getCmp(b.startNumberField);if(d){d.setMaxValue(c);b.numberRangeMax=c;d.validate()}}else{if(b.endNumberField&&(!b.numberRangeMin||(c!=b.numberRangeMin))){var a=Ext.getCmp(b.endNumberField);if(a){a.setMinValue(c);b.numberRangeMin=c;a.validate()}}}return true},password:function(c,b){if(b.initialPassField){var a=b.up("form").down("#"+b.initialPassField);return(c==a.getValue())}return true},passwordText:"Passwords do not match"})});